import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import apiClient from '../api/apiClient';

const Navbar = () => {
    const [profilePhoto, setProfilePhoto] = useState(null);
    const [mobileOpen, setMobileOpen] = useState(false); // State to handle drawer

    useEffect(() => {
        const fetchProfilePhoto = async () => {
            try {
                const response = await apiClient.get('/freelancers/profile', {
                    headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
                });
                setProfilePhoto(response.data.data.profilePhoto);
            } catch (error) {
                console.error(error);
            }
        };
        fetchProfilePhoto();
    }, []);

    const handleDrawerToggle = () => {
        setMobileOpen(!mobileOpen); // Toggle drawer state
    };

    const drawer = (
        <List>
            <ListItem button component={Link} to="/" onClick={() => setMobileOpen(false)}>
                <ListItemText primary="Home" />
            </ListItem>
            <ListItem button component={Link} to="/dashboard" onClick={() => setMobileOpen(false)}>
                <ListItemText primary="Opportunities" />
            </ListItem>
            <ListItem button component={Link} to="/profile" onClick={() => setMobileOpen(false)}>
                <ListItemText primary="Profile" />
            </ListItem>
        </List>
    );

    return (
        <>
            <AppBar position="static" color="primary">
                <Toolbar>
                    <Typography variant="h6" sx={{ flexGrow: 1 }}>
                        SkilHire
                    </Typography>
                    <IconButton
                        color="inherit"
                        edge="start"
                        aria-label="menu"
                        sx={{ display: { xs: 'block', md: 'none' } }}
                        onClick={handleDrawerToggle}
                    >
                        <MenuIcon />
                    </IconButton>
                    <Button
                        color="inherit"
                        component={Link}
                        to="/"
                        sx={{ display: { xs: 'none', md: 'block' } }}
                    >
                        Home
                    </Button>
                    <Button
                        color="inherit"
                        component={Link}
                        to="/dashboard"
                        sx={{ display: { xs: 'none', md: 'block' } }}
                    >
                        Opportunities
                    </Button>
                    <Button
                        color="inherit"
                        component={Link}
                        to="/profile"
                        sx={{ display: { xs: 'none', md: 'block' } }}
                    >
                        Profile
                    </Button>
                    <Avatar
                        alt="Profile Photo"
                        src={profilePhoto}
                        sx={{ ml: 2, display: { xs: 'none', md: 'block' } }}
                    />
                </Toolbar>
            </AppBar>
            <Drawer
                anchor="left"
                open={mobileOpen}
                onClose={handleDrawerToggle}
                sx={{ display: { xs: 'block', md: 'none' } }}
            >
                {drawer}
            </Drawer>
        </>
    );
};

export default Navbar;
